import React from 'react'

export default function Signup() {
  const hanelSubmit = (e)=>{
    e.preventDefault();
  }
  return (
    <>
<form onSubmit={hanelSubmit} className='form'>
  <label htmlFor="">userName</label>
  <input type="text" placeholder='userName' className='form' />







</form>
    </>
  )
}
